import React from "react";
import {Link} from "react-router-dom"
const Navbar = ()=>{
    return(
        <>
            <header className="header">
            <ul className="navbar">
            <li><Link to="/">Home</Link></li>
            <li><Link to="/">Shop</Link></li>
            <li><Link>About</Link></li>
            <li><Link>Contact</Link></li>
            </ul>
            </header>
        </>
    )
}

export default Navbar;
